const JTemplate = ({ header, content, btnText }) => {
  return (
    <div className="bg-image-1 h-screen w-screen z-0 bg-center flex items-center">
      <div className="text-white flex flex-col px-2 max-w-sm ml-20">
        <span className="font-black uppercase text-4xl tracking-wider">
          {header}
        </span>
        <span className="text-lg my-8">
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Auctor ac
          tristique pellentesque sagittis aliquet nunc. In cursus erat odio
          arcu, ornare. Sed risus et.
        </span>
        <button className="bg-yellow-500 w-2/3 py-2 rounded-md">
          GET STARTED
        </button>
      </div>
    </div>
  );
};

export default JTemplate;
